import Button from 'react-bootstrap/Button';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Popover from 'react-bootstrap/Popover';
import Duvida from "../imagens/duvida.svg"

function Popover_() {
  return (
    <>
      {['left'].map((placement) => (
        <OverlayTrigger
          trigger="click"
          key={placement}
          placement={placement}
          overlay={
            <Popover id={`popover-positioned-${placement}`}>
              <Popover.Body>
                <p className='font_popover'>
                Atividade do grupo VII (Outras atividades) com base  no Regulamento de Programa de Atividades Complementares.
                </p>
              
              </Popover.Body>
            </Popover>
          }
        >
          <Button variant="link"><img src={Duvida} alt="pop_over" className=""/> </Button>
        </OverlayTrigger>
      ))}
    </>
  );
}

export default Popover_;
